// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract  Immutable {

    address public  immutable MY_ADDRESS;
    uint public immutable numb;

    //constructor 指合约部署时跟着初始化的含糊  （构造函数）
    constructor(){
        MY_ADDRESS = msg.sender;
        numb = 200;

    }
    
}

